import './style.css'

export default function SignUpFooter() {
  return (
    <section className="sign-footer" >
      <LanguageSelector />
      <Links />
    </section>
  );
}

const LanguageSelector = () => (
    <button className="language">
      Language
    </button>
  );

  const Links = () => (
    <ul className="footer-links">
      <li>Help</li>
      <li>Privacy</li>
      <li>Terms</li>
    </ul>
  );
